        this.state = {robots: robots, searfield: ""};
    }


    render(){
        return (

            <div className="tc">
                <h1 >RobotFriends</h1>
                <SearchBox></SearchBox>
                <CardList robots = {robots} />
            </div>
        );
    }
};

export default App;
